import React, { useState } from "react";

function GamePage({ gamePath, finishGame, prompt }) {
  const [isFinished, setIsFinished] = useState(false);

  const handleFinish = (chosenOptionIndex, chosenDescriptors) => {
    setIsFinished(true);
    finishGame(chosenOptionIndex, chosenDescriptors);
  };

  return (
    <div className="appSecond">
      <GamePage gamePath={gamePath} prompt={prompt} finishGame={handleFinish} />
    </div>
  );
}

export default GamePage;
